import { useState, useEffect } from "react";
import { Button } from "@/components/ui/button";
import { Card, CardContent } from "@/components/ui/card";
import { motion } from "framer-motion";
import { BarChart, CreditCard, Layers, Package, ShoppingCart, TrendingUp, Users } from "lucide-react";

export default function LandingPage() {
  const [showNavbar, setShowNavbar] = useState(true);
  let lastScrollY = 0;

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > lastScrollY) {
        setShowNavbar(false);
      } else {
        setShowNavbar(true);
      }
      lastScrollY = window.scrollY;
    };

    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <div className="min-h-screen bg-white text-gray-900">
      {/* Navbar */}
      <nav className={`fixed top-0 left-0 w-full flex justify-between items-center p-4 bg-transparent backdrop-blur-md z-10 transition-transform duration-300 ${showNavbar ? "translate-y-0" : "-translate-y-full"}`}>
        <h1 className="text-4xl font-black text-blue-900 tracking-wide">RetailBridge</h1>
        <div>
          <Button className="mr-4 bg-gradient-to-r from-blue-600 to-indigo-800 text-white px-6 py-3 rounded-md shadow-md hover:scale-105 transition-transform">Login</Button>
          <Button className="bg-gray-200 text-gray-900 px-5 py-3 rounded-md shadow-md hover:bg-gray-300">
            <Layers className="w-5 h-5" />
          </Button>
        </div>
      </nav>

      {/* Hero Section */}
      <section className="relative text-left py-48 px-12 text-gray-900 mt-16 flex flex-col items-start justify-center bg-cover bg-center" style={{ backgroundImage: "url('https://www.sap.com/dam/application/shared/photos/homepage/business-unleashed-feb-20.jpg/_jcr_content/renditions/business-unleashed-feb-20_homepage_0979_0686.jpg.adapt.979_686.false.false.false.false.jpg/1740085168742.jpg')" }}>
        <div className="max-w-4xl">
          <h1 className="text-7xl font-extrabold leading-tight drop-shadow-md text-gray-900">Bridging Retailers & Distributors</h1>
          <p className="mt-6 text-xl drop-shadow-md font-semibold text-gray-800">Empowering retailers with seamless inventory, billing, and business growth solutions.</p>
          <Button className="mt-8 px-12 py-4 text-lg bg-gradient-to-r from-blue-800 to-indigo-900 text-white shadow-lg rounded-md hover:scale-105 transition-transform">Get Started</Button>
        </div>
      </section>

      {/* About Us Section */}
      <section className="py-24 px-20 bg-white text-left max-w-7xl mx-auto">
        <h2 className="text-6xl font-extrabold text-gray-900 mb-8">About Us</h2>
        <p className="text-xl text-gray-700 leading-relaxed">
          RetailBridge is dedicated to revolutionizing the way retailers and distributors collaborate. 
          Our platform provides innovative solutions for inventory management, billing, and supply chain 
          optimization, ensuring seamless business operations. We empower retailers with analytics and 
          curated business support, helping them grow and succeed in a competitive market.
        </p>
      </section>

      {/* Features Section */}
      <section className="py-16 px-6 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        {[
          { title: "Inventory Management", desc: "Stay updated with real-time stock levels.", icon: Package },
          { title: "Billing Solutions", desc: "Generate invoices and manage transactions effortlessly.", icon: CreditCard },
          { title: "Business Credit Management", desc: "Offer and track credit transactions securely.", icon: Users },
          { title: "Supply Chain Management", desc: "Optimize and streamline supply chain operations.", icon: ShoppingCart },
          { title: "Growth & Analytics", desc: "Gain insights to scale your business effectively.", icon: BarChart },
          { title: "Curated Business Support", desc: "Get expert advice and tailored support.", icon: TrendingUp },
        ].map((feature, index) => (
          <motion.div key={index} whileHover={{ scale: 1.05 }}>
            <Card className="p-6 shadow-lg flex flex-col items-center text-center h-full">
              <CardContent className="flex flex-col items-center justify-between h-full">
                <feature.icon className="w-16 h-16 text-blue-800 mx-auto mb-4" />
                <h3 className="text-xl font-bold mt-2">{feature.title}</h3>
                <p className="mt-2 text-gray-700">{feature.desc}</p>
              </CardContent>
            </Card>
          </motion.div>
        ))}
      </section>

      {/* Footer */}
      <footer className="bg-gray-900 text-gray-300 py-10 mt-12">
        <div className="container mx-auto px-6 grid grid-cols-1 md:grid-cols-3 gap-8 text-center md:text-left">
          <div>
            <h3 className="text-xl font-bold text-white">RetailBridge</h3>
            <p className="mt-2">Connecting retailers with distributors for seamless business management.</p>
          </div>
          <div>
            <h3 className="text-lg font-bold text-white">Quick Links</h3>
            <ul className="mt-2 space-y-2">
              <li><a href="#" className="hover:text-white">Home</a></li>
              <li><a href="#" className="hover:text-white">Features</a></li>
              <li><a href="#" className="hover:text-white">Pricing</a></li>
              <li><a href="#" className="hover:text-white">Contact</a></li>
            </ul>
          </div>
          <div>
            <h3 className="text-lg font-bold text-white">Contact Us</h3>
            <p className="mt-2">Email: support@retailbridge.com</p>
            <p>Phone: +1 234 567 890</p>
            <p>Address: 123 Business Street, City, Country</p>
          </div>
        </div>
        <div className="text-center mt-8 text-gray-500 text-sm">
          &copy; {new Date().getFullYear()} RetailBridge. All rights reserved.
        </div>
      </footer>
    </div>
  );
}
